    "def check_duplicates():\n",
    "    query = '''\n",
    "    SELECT date, hour, COUNT(*)\n",
    "    FROM WeatherData\n",
    "    GROUP BY date, hour\n",
    "    HAVING COUNT(*) > 1\n",
    "    '''\n",
    "    cur.execute(query)\n",
    "    duplicates = cur.fetchall()\n",
    "    if duplicates:\n",
    "        print(f\"Found duplicates: {duplicates}\")\n",
    "    else:\n",
    "        print(\"No duplicates found.\")\n",
    "\n",
    "# Call the function\n",
    "check_duplicates()\n"
