    "def remove_duplicates():\n",
    "    query = '''\n",
    "    DELETE FROM WeatherData\n",
    "    WHERE ROWID NOT IN (\n",
    "        SELECT MIN(ROWID)\n",
    "        FROM WeatherData\n",
    "        GROUP BY date, hour, location\n",
    "    )\n",
    "    '''\n",
    "    cur.execute(query)\n",
    "    conn.commit()\n",
    "    print(\"Duplicates removed successfully.\")\n",
    "\n",
